In questo esempio utilizzeremo per il servizio di naming Java RMI registry rmiregistry presente nella directory bin della jdk, per permettere al registro di caricare la codebase necessaria dobbiamo avviarlo all'interno della directory contente i file .classdel nostro progetto, nel costro caso la direcory $Project/build/classes Per i nostri scopi definiamo un nuovo SecurityManager che garantisce una politica AllPermission. Per la lookup degli oggetti remoti utilizzeremo la classe Naming . Material di supporto: Oracle Getting Started Using Java RMI Definizione interfaccia remota Hello.java public interface Hello extends java.rmi.Remote { String dimmiQualcosa(String daChi) throws java.rmi.RemoteException; } Implementazione dell'oggetto remoto HelloImpl.java import java.rmi.*;
import java.rmi.server.UnicastRemoteObject; import java.security.Permission;
import java.util.logging.Logger;
public class HelloImpl extends UnicastRemoteObject implements Hello { private static final long serialVersionUID = -4469091140865645865L; static Logger logger= Logger.getLogger("global"); public HelloImpl() throws RemoteException { } public String dimmiQualcosa(String daChi) throws RemoteException { logger.info("Sto salutando "+daChi); return "Ciao "+daChi+"!"; } public static void main(String args[]) throws RemoteException { //questo codice permette di evitare di scrivere il file policy System.setSecurityManager(new SecurityManager() { @Override public void checkPermission(Permission perm) { } @Override public void checkPermission(Permission perm, Object context) { } }); try { logger.info("Creo l’oggetto remoto..."); HelloImpl obj = new HelloImpl(); logger.info("... ne effettuo il rebind..."); Naming.rebind("HelloServer", obj); logger.info("... Pronto!"); } catch (Exception e) { e.printStackTrace(); } }
} Definizione del client che utilizza l'oggetto remoto HelloClient.java import java.rmi.*;
import java.util.logging.Logger;
public class HelloClient { static Logger logger= Logger.getLogger("global"); public static void main(String args[]) { try { logger.info("Sto cercando l’oggetto remoto..."); Hello obj = (Hello) Naming.lookup("rmi://localhost/HelloServer"); logger.info("... Trovato! Invoco metodo..."); String risultato = obj.dimmiQualcosa("Pippo"); System.out.println("Ricevuto:"+ risultato); } catch (Exception e) { e.printStackTrace(); } }
} Esecuzione del progetto avviare rmiregistry dalla directory ~/$PROJECT_NAME/build/classes porta di default rmiregistry 1099. eseguire HelloImpl.javada netbeans tasto destro run file. eseguire HelloClient.javada netbeans tasto destro run file.

